import './Menus.css';


function Menus(props) {
    return (
        <div>
            <h1>Menus</h1>
            {props.data.map((val, index) => {
                return <h4 onClick={()=> {
                    props.showDetails(index)
                }} key={index}>{val}</h4>
            })}
        </div>
    )

}
export default Menus;
